import React from 'react'
import {SearchOutlined, Notifications} from '@material-ui/icons'
import {Grid} from '@material-ui/core'
import {Star} from '@material-ui/icons'
import colors from '../../tools/colors'

const CardMovie = () => {
  return (
    <Grid container spacing={1}>
        <Grid xs={12} sm={12} md={12} lg={12} xl={12} item>
          <div className="img-movie-div">
            <img src="https://asset.kompas.com/crops/2vpXZ8VEtMW84mrg5hEzb3tFRF8=/0x0:791x527/750x500/data/photo/2017/11/05/1132136128.jpeg" className="img-movie" />
          </div>
        </Grid>
        <Grid xs={12} sm={12} md={12} lg={12} xl={12} item>
          <div className="detail-movie">
            <p className="genre-date">Action, scifi | 20 Oct 2019</p>
            <p className="title-movie">Iron man</p>
            <p className="rating-movie"><Star style={{color : colors.yellow2, fontSize : 12}} /> &nbsp;9.0/10</p>
          </div>
        </Grid>
        <style jsx>{`
          .container-CardMovie {
                display: flex;
                flex-direction:column;
                font-family: Poppins;
          }
          .img-movie-div {
            height: 200px;
            width: 125px;
            border-radius: 10px;

          }

          .img-movie {
            height: 200px;
            width: 125px;
            border-radius: 10px;
          }

          .detail-movie {
            width : 200px;
          }
          .genre-date {
            font-size: 10px;
            font-weight: 400;
            font-family: Poppins;
          }
          .title-movie {
            font-size: 14px;
            font-weight: 700;
            font-family: Poppins;
          }
          .rating-movie {
            font-size: 10px;
            font-weight: 700;
            font-family: Poppins;
          }



          `}</style>
    </Grid>
  )
}
export default CardMovie
